(169, 1, '2021-02-18 17:54:24', '2021-02-18 16:54:24', 'The Supreme x Louis Vuitton x Red Ribbon Recon x Air Jordan 1 Retro High sneaker boasts an ultra-luxe look in this drop from sneaker customizer Red Ribbon Recon. The custom design features the body of the Air Jordan 1 as its base, with its upper constructed with the LV logo-heavy red denim baseball jersey from the 2017 Supreme x LV collaboration. A satin tongue with a Red Robin leather patch and classic Nike Air branding are met with a lambskin leather Swoosh to complete the design.', 'Supreme x Louis Vuitton x Red Ribbon Recon x Air Jordan 1 Retro High', '', 'publish', 'open', 'closed', '', 'supreme-x-louis-vuitton-x-red-ribbon-recon-x-air-jordan-1-retro-high', '', '', '2021-02-18 17:56:42', '2021-02-18 16:56:42', '', 0, 'http://monsite/?post_type=product&#038;p=169', 0, 'product', '', 0),
