(174, 1, '2021-02-18 17:55:53', '2021-02-18 16:55:53', 'Limited to just 8,500 pairs, the Air Jordan 1 Low OG ‘Chinese New Year’ celebrates the lunar holiday with classic ‘Bred’ color blocking and a festive jacquard print throughout the textile upper. The embroidered graphics include florals and overt references to the year of the ox, along with a gold Jordan Wings logo on the heel tab. Standard Nike Air branding adorns the woven tongue tag and sockliner. The kicks are packaged with a tasseled rope bracelet and a red envelope containing a collectible card, both inspired by Chinese New Year gifting traditions.', 'Air Jordan 1 Low OG \'Chinese New Year\'', '', 'publish', 'open', 'closed', '', 'air-jordan-1-low-og-chinese-new-year', '', '', '2021-02-18 17:55:53', '2021-02-18 16:55:53', '', 0, 'http://monsite/?post_type=product&#038;p=174', 0, 'product', '', 0),
