(180, 1, '2021-02-18 18:00:16', '2021-02-18 17:00:16', 'Bridging the gap between street-ready sportswear and luxury fashion, the Dior x Air Jordan 1 High is drawn from a larger collaboration that spans footwear, apparel and accessories. Designer Kim Jones’ take on the iconic sneaker makes use of a white and grey upper constructed from Italian leather with hand-painted edges. Dual branding hits take the form of a Dior woven tongue tag, a Nike Swoosh in Dior Oblique jacquard, and icy outsoles revealing a Dior and Dior Wings logo on each shoe.', 'Dior x Air Jordan 1 High', '', 'publish', 'open', 'closed', '', 'dior-x-air-jordan-1-high', '', '', '2021-02-18 18:00:16', '2021-02-18 17:00:16', '', 0, 'http://monsite/?post_type=product&#038;p=180', 0, 'product', '', 0),
