(182, 1, '2021-02-18 18:02:10', '2021-02-18 17:02:10', '', 'Wmns Air Jordan 1 Low \'UNC\'', 'The Air Jordan 1 Low ‘UNC’ features a simple two-tone color scheme that pays homage to Michael Jordan’s alma mater. The all-leather upper applies University Blue overlays on a crisp white base, complete with a padded collar for a comfortable fit and perforated detailing on the toe box for added breathability. Branding elements include a Jumpman atop the tongue and the Jordan Wings logo embroidered on the heel panel.', 'publish', 'open', 'closed', '', 'wmns-air-jordan-1-low-unc', '', '', '2021-02-18 18:02:11', '2021-02-18 17:02:11', '', 0, 'http://monsite/?post_type=product&#038;p=182', 0, 'product', '', 0),
(183, 1, '2021-02-18 18:04:31', '2021-02-18 17:04:31', 'Created by designer Virgil Abloh, the Air Jordan 1 x Off-White comes in the classic Chicago colorway. Some of the sneakers\' half-finished features include a Swoosh connected to the shoe with visible blue stitching, \'Air\' printed on the midsole, and an Off-White zip tie on the collar. The box comes deconstructed as it\'s been turned inside-out with the inside consisting of a black base and gold Jumpman logo, while the outside is plain cardboard with the words \'Jumpman\' printed on it. Virgil\'s Off-White collection included remixed iterations of the Air VaporMax, Air Presto, Air Max 90, Blazer, Air Max 97, Hyperdunk 2017, Air Force 1, Zoom Fly, and Chuck Taylor.', 'Off-White x Air Jordan 1 Retro High OG \'Chicago\'', '', 'publish', 'open', 'closed', '', 'off-white-x-air-jordan-1-retro-high-og-chicago', '', '', '2021-02-18 18:04:32', '2021-02-18 17:04:32', '', 0, 'http://monsite/?post_type=product&#038;p=183', 0, 'product', '', 0),
