(15, 1, '2021-02-18 07:02:40', '2021-02-18 06:02:40', 'Limited to just 12,000 pairs, the Trophy Room x Air Jordan 1 Retro High OG SP ‘Chicago’ draws inspiration from a moment in NBA history dubbed ‘the freezeout’: in 1985, playing in his first ever All-Star Game, MJ was reportedly denied the ball by established stars who wanted to embarrass the brash rookie. Marcus Jordan’s sneaker boutique dresses the high-top in an OG-inspired palette, featuring white leather base with a black Swoosh and red leather overlays in a subtle frozen finish. MJ’s signature is scrawled across the lateral heel, while a dual-branded patch adorns the sockliner. The sneaker’s tooling pairs a vintage off-white midsole with an icy translucent rubber outsole.', 'Trophy Room x Air Jordan 1 Retro High OG SP \'Chicago\'', '<a class=\"ProductTemplateBreadcrumbs__Crumb-ossiuz-2 ProductTemplateBreadcrumbs__BrandCrumb-ossiuz-3 iZiFFY\" href=\"https://www.goat.com/sneakers/brand/air-jordan\" data-qa=\"pdp_breadcrumb_brand\">Air Jordan</a> / <a class=\"ProductTemplateBreadcrumbs__Crumb-ossiuz-2 gUoyGx\" href=\"https://www.goat.com/sneakers/silhouette/air-jordan-1\" data-qa=\"product-template-breadcrumb-crumb\">Air Jordan 1</a><span class=\"ProductTemplateBreadcrumbs__ProductName-ossiuz-1 gPoSEi\" data-qa=\"pdp_breadcrumb_name\"> / Trophy Room x Air Jordan 1 Retro High OG SP \'Chicago\'</span>', 'publish', 'open', 'closed', '', 'trophy-room-x-air-jordan-1-retro-high-og-sp-chicago', '', '', '2021-02-19 02:49:42', '2021-02-19 01:49:42', '', 0, 'http://monsite/?post_type=product&#038;p=15', 0, 'product', '', 1),
