(20, 1, '2021-02-18 07:10:18', '2021-02-18 06:10:18', 'The Air Jordan 1 Retro High OG is a work of nostalgia, modernizing the 1985 icon\'s distinctive elements to honor Michael Jordan\'s legendary career arc. Debuted in August 2019, this \'Obsidian\' version tributes MJ\'s college alma mater through a team-inspired, color block palette on the leather upper. Matching branding notes and Swooshes play their part in the homage. The Nike Air infused midsole and circular rubber outsole supply classic comfort and traction.', 'Air Jordan 1 Retro High OG', '<a class=\"ProductTemplateBreadcrumbs__Crumb-ossiuz-2 ProductTemplateBreadcrumbs__BrandCrumb-ossiuz-3 iZiFFY\" href=\"https://www.goat.com/sneakers/brand/air-jordan\" data-qa=\"pdp_breadcrumb_brand\">Air Jordan</a> / <a class=\"ProductTemplateBreadcrumbs__Crumb-ossiuz-2 gUoyGx\" href=\"https://www.goat.com/sneakers/silhouette/air-jordan-1\" data-qa=\"product-template-breadcrumb-crumb\">Air Jordan 1</a><span class=\"ProductTemplateBreadcrumbs__ProductName-ossiuz-1 gPoSEi\" data-qa=\"pdp_breadcrumb_name\"> / Air Jordan 1 Retro High OG \'Obsidian\'</span>', 'publish', 'open', 'closed', '', 'air-jordan-1-retro-high-og', '', '', '2021-02-18 08:15:03', '2021-02-18 07:15:03', '', 0, 'http://monsite/?post_type=product&#038;p=20', 0, 'product', '', 0),
